import React, {useState} from 'react';
import TinderCard from "react-tinder-card";


function TinderCards () {
    const [people, setPeople] = useState([
        {
            name:'Harry Alpha',
            url:'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.cosmopolitan.com%2Fsex-love%2Fnews%2Fa48549%2Fweird-random-man-thoughts%2F&psig=AOvVaw09zxN4cg2kFkw-mG7SC-C6&ust=1647800138549000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCMj-pILk0vYCFQAAAAAdAAAAABAD'
        },
        {
            name:'Bob Geldoff',
            url:'https://www.google.com/url?sa=i&url=https%3A%2F%2Fm.facebook.com%2Fdyrandoms%2Fphotos%2F%3Ftab%3Dalbums%26mt_nav%3D1&psig=AOvVaw09zxN4cg2kFkw-mG7SC-C6&ust=1647800138549000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCMj-pILk0vYCFQAAAAAdAAAAABAN'
        }
    ]);

    return (
        <div>
            {people.map(person =>{
                <TinderCard className = "swipe" key={person.name}>
                    <div 
                    style={{backgroungImage: `url(${person.url})`}}
                    className='card'>
                        <h3>{person.name}</h3>
                    </div>
                </TinderCard>
            })}
        </div>
    );
}


export default TinderCards;
